import React, { useState } from 'react';

interface TrackerProps {
  initialSteps: number;
  initialCalories: number;
}

const Tracker: React.FC<TrackerProps> = ({ initialSteps, initialCalories }) => {
  const [steps, setSteps] = useState(initialSteps);
  const [calories, setCalories] = useState(initialCalories);

  const handleStepChange = (event: React.ChangeEvent<HTMLInputElement>) => {
    setSteps(Number(event.target.value));
  };

  const handleCalorieChange = (event: React.ChangeEvent<HTMLInputElement>) => {
    setCalories(Number(event.target.value));
  };

  return (
    <div>
      <h2>Fitness Tracker</h2>
      <div>
        <label>
          Steps:
          <input type="number" value={steps} onChange={handleStepChange} />
        </label>
      </div>
      <div>
        <label>
          Calories:
          <input type="number" value={calories} onChange={handleCalorieChange} />
        </label>
      </div>
      <div>
        <p>Total Steps: {steps}</p>
        <p>Total Calories: {calories}</p>
      </div>
    </div>
  );
};

export default Tracker;
